const islandPerimeter = grid => {
  let islands = 0, neighbors = 0;
  for(let i = 0; i < grid.length; i++) {
    for(let j = 0; j < grid[i].length; j++) {
      islands++;
      if (i > 0 && grid[i-1][j] === 1) { neighbors ++; }
      if (j > 0 && grid[i][j-1] === 1) { neighbors ++; }
    }
  }
  return islands*4 - neighbors*2;
};

